("selectedLanguage"),as=q1({legacy:!1,locale:lg||"en",messages:{en:{home:"HOME",home_jobs:"Data Analyst & Web Developer",about_me:"ABOUT ME",about_me_p1:"Hello ! I am Habib HAMMARLEBIOD, a passionate and versatile professional with a master's degree in Data Analytics and a solid background in web development. With over three years of experience, I've had the privilege to work for major account clients in the telecommunication and aeronautics industries, where I honed my expertise and navigated the dynamic landscape of data and technology.",about_me_p2:"With a strong foundation in data analytics, I possess a knack for deciphering patterns, deriving meaningful insights, and driving informed decisions from complex data sets. My academic journey equipped me with the analytical and problem-solving skills essential to excel in this field. Concurrently, my experience as a web developer has provided me with a comprehensive understanding of front-end and back-end technologies, enabling me to bring ideas to life through intuitive and engaging web interfaces.",about_me_p3:"During my tenure at Capgemini Engineering, I actively engaged in leveraging modern tools and technologies to manipulate, analyze, and visualize data effectively, contributing to streamlined processes and improved outcomes. Simultaneously, I dedicated my efforts to developing web applications from scratch, enhancing user experiences, and ensuring seamless functionality across various platforms.",about_me_p4:"My journey in the world of data analytics and web development has instilled in me a strong sense of dedication, a collaborative spirit, and an insatiable curiosity to explore new horizons within these dynamic domains. Beyond my professional endeavors, I am committed to continuous growth, always eager to expand my knowledge and stay updated with the latest trends and advancements in both data analytics and web development.",about_me_p5:"Thank you for visiting my portfolio. I look forward to connecting and collaborating with fellow enthusiasts.",projects:"PROJECTS",gpi_intro:"In my most recent venture, I joined a forward-thinking startup where I led the creation of a real estate website from the ground up. GROUPINVESTO brings a modern and innovative approach to real estate by favoring collaborative investments. This platform allows users to invest the amount they want on the chosen property before getting in touch with future co-investors thanks to advisors.",gpi_t1:"Restful API",gpi_p1:"Leveraging my knowledge in web development, I architected this dynamic website using a robust tech stack to build a REST API. At its core was the Django REST Framework, providing a solid foundation for creating a highly scalable backend, paired with PostgreSQL to ensure optimal data management and performance.",gpi_t2:"VUE 3 FOR A DYNAMIC UI",gpi_p2:"To create a modern and intuitive user interface, I turned to Vue 3, a progressive JavaScript framework known for its reactivity and effortless integration. Vue 3 allowed me to build a dynamic frontend that seamlessly interacted with the backend, resulting in a smooth and engaging user experience.",gpi_t3:"TAILWIND CSS: AESTHETIC EXCELLENCE WITH EFFICIENCY",gpi_p3:"In order to reach a streamlined aesthetic, Tailwind CSS became an obvious choice as my go-to utility-first CSS framework. This decision allowed me to rapidly style and design the website, achieving a visually pleasing and responsive layout without compromising on efficiency.",gpi_t4:"SECURING DATA WITH JSON WEB TOKEN AUTHENTICATION",gpi_p4:"Ensuring utmost security and privacy for our users was very important. To achieve this, I implemented JSON Web Token (JWT) authentication, a robust and industry-standard method for securing data transmission. This approach significantly enhanced the website's security, providing our users with a safe and trustworthy environment.",gpi_t5:"RESULTS THAT RESONATE",gpi_p5:"The end result was a website that seamlessly combined functionality, aesthetics, and security. Users experienced a sleek, responsive interface, enabling effortless navigation and interaction. Additionally, the startup achieved heightened user engagement and positive feedback, setting the stage for future growth and success.",gpi_p6:"GO TO GROUPINVESTO.COM",portfolio:"Project: Personal Portfolio Website",portfolio_t1:"Objective:",portfolio_p1:"Design and develop a personal portfolio website with Vue 3 and Tailwind CSS, focusing on an original, modern, and app-like design with smooth transitions to provide an exceptional user experience.",portfolio_t2:"Technologies and Tools:",portfolio_t3:"Key Features:",portfolio_f1:"Unique and modern design",portfolio_f2:"Smooth transitions for an app-like experience",portfolio_f3:"'About Me' section showcasing my background and skills",portfolio_f4:"Project showcase with detailed descriptions",portfolio_f5:"Contact section for inquiries and collaborations",portfolio_t4:"Description:",portfolio_p4:"This project was an exciting way to create a distinct and original personal portfolio website that stands out in design and functionality. Using Vue 3 and Tailwind CSS, I crafted a seamless, visual interface that blurs the line between a traditional website and a dedicated application. The emphasis was on providing users with an engaging experience akin to using a well-designed app, featuring smooth transitions and an intuitive user interface. The website showcases an 'About Me' section, offering insights into my background and skills. The project section provides a detailed view of various projects, highlighting my work and achievements. The 'Experience' and 'Skills' pages show both my career path and the abilities I developed along the way. Finally, a 'Contact' section allows for easy communication and collaboration opportunities. The design is carefully crafted to be both modern and readable, ensuring a delightful user experience while maintaining a professional outlook.",portfolio_t5:"Outcome:",portfolio_p5:"The completed personal portfolio website offers an original, modern, and app-like design. Vue 3 and Tailwind CSS proved to be powerful allies in achieving a captivating and responsive interface. The smooth transitions enhance user engagement, providing a seamless experience through my professional journey and skills, ultimately amplifying the impact of my portfolio.",orange_t1:"PROJECT: NATIONWIDE FIBER OPTICS NETWORK DEPLOYMENT MONITORING",orange_p1:"At a pivotal juncture in my career, I had the distinct privilege of contributing to a great telecommunications initiative at Orange. Tasked with overseeing the deployment of a fiber optics network spanning metropolitan France, I embarked on a journey that showcased the transformative power of data-driven decision-making.",orange_t2:"Harnessing Data for Strategic Insights:",orange_p2:"My primary mission was to establish a robust monitoring system, leveraging the potential of data analytics to provide strategic insights into the nationwide deployment. Recognizing the pivotal role of accurate and up-to-date data, I set out to create an automated data pipeline, a lifeblood for informed decision-making.",orange_t3:"Data Pipeline and ETL Process:",orange_p3:"Despite the constraint of not being able to use a traditional ETL, I was able, through the use of Excel, VBA, and SQL Server, to orchestrate a data pipeline that seamlessly extracted, transformed, and loaded critical deployment data. This automation ensured that each week, the data was updated effortlessly, maintaining its relevance and accuracy.",orange_t4:"Empowering with VBA Macros:",orange_p4:"The heart of this automation lay in VBA macros. These macros powered the automated ETL process, pulling data from various sources, transforming it into a meaningful format, by elaborating the required data warehouse and data marts. This level of automation made the information much more accessible and significantly optimized efficiency.",orange_t5:"Dynamic Power BI Dashboards:",orange_p5:"On this robust data foundation, I built Power BI dashboards that presented a dynamic and real-time view of the network deployment. These dashboards not only provided a visual narrative of the progress but also allowed for in-depth analysis and insights. Stakeholders could effortlessly track the deployment's status, identify bottlenecks, and make informed decisions to ensure the project's success.",orange_t6:"Impact and Continued Evolution:",orange_p6:"The result of this effort was a significant time saver within the organization, where data-driven decisions became the cornerstone of the nationwide fiber optics network deployment. The system I engineered not only streamlined operations but also empowered stakeholders with the actionable intelligence necessary to drive progress. This experience reinforced my belief in the transformative potential of data analytics, showcasing how innovation and resourcefulness can overcome challenges. It cemented my commitment to leveraging the power of data to drive positive change and operational excellence.",airbus_t1:"Project: Network Infrastructure Renewal in Aeronautics",airbus_p1:"In the fast-paced realm of aeronautics, where precision and efficiency reign supreme, I was entrusted with a pivotal role in the overhaul of network infrastructure for a leading aeronautics company. This undertaking challenged me to elevate monitoring, establish critical KPIs, and drive productivity, all while adhering to agile principles.",airbus_t2:"Empowering Data-Driven Decision-Making:",airbus_p2:"My primary goal was to improve the way we monitored network infrastructure renewal. Harnessing the power of data analytics, I aimed to provide real-time insights that would steer decision-making, bolster productivity, and ensure the seamless operation of critical network systems. In pursuit of this vision, I designed and developed intuitive dashboards that offered a comprehensive and real-time view of the network infrastructure renewal. These dashboards served as an interactive window, empowering stakeholders to monitor progress, identify potential roadblocks, and make informed decisions swiftly and effectively.",airbus_t3:"Key Performance Indicators (KPIs):",airbus_p3:"Recognizing the importance of tracking technician productivity, I established key performance indicators (KPIs). These KPIs were meticulously crafted to gauge various aspects of productivity, enabling us to measure progress, identify areas for improvement, and optimize resource allocation.",airbus_t4:"Agile Practices and JIRA Integration:",airbus_p4:"Operating within the agile framework, I diligently managed tickets and workflows utilizing JIRA. This integration facilitated seamless communication, task tracking, and iterative development, aligning our efforts with agile principles to maximize efficiency and ensure project success.",airbus_t5:"Empowering Excellence and Progress:",airbus_p5:"The refined monitoring systems and productivity-focused approach significantly improved the renewal process. Stakeholders were equipped with the tools and insights needed to steer the project towards success, ensuring a robust network infrastructure for critical operations. This experience crystallized my belief in the potential of data-driven solutions and the transformative influence of agile methodologies. It affirmed my dedication to utilizing technology and innovation to drive progress in critical and dynamic sectors like aeronautics.",fandco_t1:"Internship: Elevating Business Intelligence in the Social Network Industry",fandco_p1:"During a pivotal internship in the social network industry, I collaborated with a dynamic small-scale company that was determined to enhance its B2B offerings. This enriching experience saw me undertake two primary tasks: automating existing business reports and developing dashboards to showcase the app's value proposition for potential B2B clients.",fandco_t2:"Automating Business Reports:",fandco_p2:"At the outset, I delved into the existing reporting system, identifying opportunities to streamline and automate the reporting process. Leveraging my expertise, I crafted automated workflows that significantly reduced manual efforts, ensuring timely and accurate generation of essential business reports. This automation not only increased efficiency but also freed up valuable time for the team to focus on strategic endeavors.",fandco_t3:"Empowering B2B Growth with Dashboards:",fandco_p3:"The second aspect of my internship involved the creation of comprehensive dashboards to catalyze the B2B growth trajectory. The objective was clear: showcase the app's value to potential corporate clients seeking a premium version. I meticulously designed dashboards that succinctly illustrated the app's advantages, focusing on how it could enhance their operations, engagement, and overall user experience. These dashboards proved instrumental in communicating the app's value proposition and fostering meaningful conversations with prospective B2B partners.",fandco_t4:"Driving Expansion and Innovation:",fandco_p4:"This internship was a rewarding journey, where I witnessed firsthand the impact of data-driven decision-making in the ever-evolving social networking landscape. The automation of business reports not only optimized internal processes but also laid the foundation for data-driven insights. Simultaneously, the tailored dashboards empowered the company to effectively position their product, paving the way for potential partnerships and expansion into the B2B market.",xp:"EXPERIENCE",full_stack_web_developer:"Full stack web developer",bi_consultant:"BI Consultant",ut1:"TOULOUSE CAPITOLE UNIVERSITY",master_miage:"Master's degree in data analytics",desc_gpi:"Created real estate website from scratch",desc_orange:"Orange : monitored fiber optics installation in Metropolitan France through Power BI dashboards",desc_airbus:"Airbus : supervised the network infrastructure renewal in France and the UK",desc_fandco1:"Developed B2B dashboards with Power BI",desc_fandco2:"Automated Excel spreadsheets using VBA macros",skills:"SKILLS",data_analysis:"DATA ANALYSIS",web_development:"WEB DEVELOPMENT",contact:"CONTACT"},fr:{home:"ACCUEIL",home_jobs:"Data Analyst & Développeur Web",about_me:"A PROPOS",about_me_p1:"Bonjour ! Je suis Habib HAMMARLEBIOD, Data analyst et développeur web avec plus de 3 ans d’expérience. Au cours de ces années, j’au eu le privilège de travailler avec des clients grand compte dans le milieu aéronautique et de la télécommunication. C’est dans ce contexte optimal d’évolution permanente, que j’ai pu acquérir et développer des compétences transversales, qu’elles soient techniques ou sociales.",about_me_p2:"Avec l’obtention d’un master MIAGE et plusieurs années d’expérience en analyse de données, je dispose des compétences et qualités globales requises pour mener à bien une mission sur l’ensemble des maillons de la chaîne BI. Parallèlement, ayant toujours eu un attrait pour le développement web, j’en ai profité pour élargir mes connaissances dans ce domaine à travers l’élaboration de plusieurs projets dont vous trouverez davantage de détails sur ce site.",about_me_p3:"Lors de mon passage chez Capgemini Engineering, j’ai été en mesure de m’adapter aux différentes missions qui m’ont été confiées et ainsi gagner en expérience grâce à leurs spécificités. L’agilité de la mission Airbus entraînant l’utilisation de logiciels comme JIRA ou encore Orange et son engagement à évoluer dans un environnement exclusivement Microsoft. Simultanément, j’ai développé des projets WEB dans leur intégralité, de la conception au déploiement, en portant une attention particulière à l’expérience utilisateur.",about_me_p4:"De la polyvalence de mon parcours émane un état d’esprit collaboratif, une curiosité et une adaptabilité m’ayant permis de m’enrichir des activités et domaines parcourus.",about_me_p5:"Merci d’avoir visité mon portfolio. Je reste ouvert à toute collaboration et suis impatient de rencontrer d’autres passionnés.",projects:"PROJETS",gpi_intro:"Lors de ma dernière expérience professionnelle, j’ai contribué au lancement d'une agence immobilière en ligne en étant responsable de la création de leur site internet, de sa conception au déploiement. GROUPINVESTO apporte une approche moderne et innovante au secteur immobilier en favorisant l’investissement collaboratif. Cette plateforme permet aux utilisateurs d’investir le montant souhaité sur un bien avant de rentrer en contact avec d’autres potentiels investisseurs grâce à une équipe de conseillers.",gpi_t1:"API REST",gpi_p1:"Afin de mener à bien ce projet, j’ai élaboré une API REST en utilisant Django Rest Framework et PostgreSQL dans le but d’établir une application dynamique, évolutive et aux performances optimales.",gpi_t2:"INTERFACE DYNAMIQUE AVEC VUE 3",gpi_p2:"La création de l’interface utilisateur s’est faite en utilisant Vue 3, un framework javascript réputé pour sa réactivité et simplicité d'intégration. Cela m’a donc permis de mettre en place le front-end, d’optimiser son intéraction avec le back-end et ainsi d’aboutir à une expérience utilisateur engageante.",gpi_t3:"TAILWIND CSS",gpi_p3:"La réalisation d’un design élégant, responsive et fonctionnel a été accomplie via Tailwind CSS. Cet outil s’est imposé naturellement, permettant un gain de temps considérable sans aucun compromis sur les objectifs fixés.",gpi_t4:"AUTHENTIFICATION JSON WEB TOKEN",gpi_p4:"Assurer la sécurité des utilisateurs est un élément fondamental. Pour y parvenir, l’authentification via JSON Web Token a été implémentée. Ce standard permet une transmission sécurisée des données et d’établir un environnement de confiance à tous les utilisateurs.",gpi_t5:"RESULTATS",gpi_p5:"Le résultat final est une application web alliant l’aspect fonctionnel, esthétique et sécuritaire sans concession. Les utilisateurs ont à leur disposition une interface dynamique et réactive leur permettant de suivre en direct l’évolution des biens présents sur le site et renforçant de ce fait, leur engagement.",gpi_p6:"VISITER GROUPINVESTO.COM",portfolio:"Projet: Portfolio",portfolio_t1:"Objectif:",portfolio_p1:"Concevoir et développer un portfolio en ligne avec Vue 3 et Tailwind CSS disposant d’un design original, moderne et fonctionnel tout en soignant l’expérience utilisateur via des transitions travaillées.",portfolio_t2:"Outils et technologies utilisés:",portfolio_t3:"Fonctionnalités clés:",portfolio_f1:"Design modern et unique",portfolio_f2:"Transitions travaillées, fluides pour une meilleure experience utilisateur",portfolio_f3:"Page 'A propos' où je me présente",portfolio_f4:"Page 'Expérience' mettant en avant mon parcours professionnel de manière concise",portfolio_f5:"Descriptions détaillées de l'ensemble de mes projets et compétences",portfolio_f6:"Permettre la prise de contact à travers un onglet dédié",portfolio_t4:"Description:",portfolio_p4:"Ce projet était un moyen intéressant de créer un portfolio unique et original tout en restant accessible dans son expérience utilisateur. L’objectif de créer une interface attrayante visuellement, se rapprochant de celle d’une application dédiée, a été réalisé en utilisant Vue 3 et Tailwind CSS. Le site comporte toutes les pages requises dans un portfolio, le tout encore une fois à travers une expérience utilisateur fluide et moderne tout en restant lisible. ",portfolio_t5:"Résultat:",portfolio_p5:"Le résultat est le site sur lequel vous naviguez en ce moment même. Les libertés prises d’un point de vue design permettent à ce projet d’accomplir son objectif aussi bien par le fond que la forme, renforçant d’autant plus son impact.",orange_t1:"PROJET: SUIVI DU DÉPLOIEMENT NATIONAL DE LA FIBRE OPTIQUE",orange_p1:"Cette mission, représentant un moment charnière dans ma carrière, m’a donné l’opportunité d’établir le suivi du déploiement de la fibre optique Orange en France métropolitaine.",orange_t2:"Affiner la prise de décision grâce à une meilleure exploitation des données",orange_p2:"Mon premier objectif était de mettre en place un monitoring efficace en utilisant l’ensemble des données liées au déploiement, y compris celles non utilisées jusque là. Cela a été fait en créant et automatisant un pipeline de données aboutissant à l’élaboration de dashboards.",orange_t3:"Acheminer les données plus efficacement",orange_p3:"Cet objectif devait être atteint sans utiliser un ETL traditionnel et a donc été réalisé en utilisant Excel, VBA et SQL Server. Le pipeline de données a été automatisé afin d’assurer que celles-ci soient mises à jour chaque semaine, maintenant ainsi la pertinence et la fiabilité des informations.",orange_t4:"Automatisation",orange_p4:"L’automatisation reposait sur l’élaboration de macros VBA. Ces dernières alimentaient le processus ETL, prenant les données à la source, les transformant au format adapté et arrivant ainsi à l’entrepôt et aux magasins de données nécessaires.",orange_t5:"Dashboards Power BI",orange_p5:"C’est à partir de cette base que les rapports Power BI ont été créés, présentant une vue en temps réel de l’évolution du déploiement. Le responsable de ce dernier peut ainsi suivre beaucoup plus efficacement son état, identifier les éléments bloquants et mener à bien le projet en ayant accès à toutes les informations nécessaires. ",orange_t6:"Impact",orange_p6:"L’impact de ce projet fut donc significatif. Les informations clés sont désormais accessibles à l’ensemble des employés concernés tandis que le manager profite d’une organisation optimisée, simplifiant la prise de décision via la mise à disposition de toutes les informations pertinentes.",airbus_t1:"Projet: Supervision du renouvellement de l'infrastructure réseau d'Airbus",airbus_p1:"Pendant cette mission Airbus, j’ai été responsable de la supervision du renouvellement de leur infrastructure réseau . Ce challenge m’a permis de mettre en oeuvre mes compétences dans une nouvelle industrie, tout en développant celles liées à la gestion de projet notamment à travers l’utilisation de JIRA et SCRUM.",airbus_t2:"Traduire les données en informations interprétables et accessibles:",airbus_p2:"Mon objectif principal était d’optimiser le monitoring du renouvellement de l’infrastructure réseau d’Airbus via l’étude de leurs données et ainsi permettre un pilotage optimal du projet. Pour ce faire, j’ai conçu des dashboards suivant l’évolution en temps réel de l’infrastructure réseau. Leur utilité était multiple : suivre l’avancement sur l’ensemble des sites, identifier les éléments bloquants, augmenter sa réactivité, mesurer la productivité des techniciens…",airbus_t3:"Indicateurs clés de performance (KPIs):",airbus_p3:"Des KPIs ont été élaborés afin de suivre avec justesse la productivité des techniciens, identifier les zones d’améliorations et optimiser l’allocation des ressources.",airbus_t4:"Méthode agile et gestion de projet avec JIRA:",airbus_p4:"Le projet suivant la méthodologie agile Scrum, j’ai également contribué à la gestion de tickets avec JIRA, fluidifiant la communication et renforçant la synergie du groupe, aboutissant à une efficacité optimale.",airbus_t5:"Meilleur suivi et identification des problèmes potentiels:",airbus_p5:"L’optimisation du monitoring et l’amélioration de la productivité en découlant ont considérablement fluidifié le processus de renouvellement de l’infrastructure réseau. La pertinence des outils et informations utilisés permet un gain de temps considérable que ce soit à l’échelle des techniciens ou d’un point de vue plus global.",fandco_t1:"Affinement de la stratégie B2B via l’élaboration de rapports d’analyse décisionnelle",fandco_p1:"Au cours de mon stage, j’ai collaboré avec Family & Co, l’entreprise derrière le réseau social FamilyWall, déterminée à améliorer son offre B2B. Cette expérience fut formatrice de par ses deux objectifs principaux : automatiser les rapports commerciaux existants et démontrer la valeur ajoutée de l’application aux clients B2B à travers l’élaboration de tableaux de bord.",fandco_t2:"Automatisation des rapports existants",fandco_p2:"Dans un premier temps, j’ai analysé les rapports existants, en identifiant les différentes possibilités d’optimisation. J’ai ensuite automatisé ces rapports à l’aide de macros VBA, requêtant directement la base de données en SQL. Cette automatisation permet non seulement une efficacité accrue, mais également un plus grand temps alloué aux efforts stratégiques.",fandco_t3:"Développement de l'aspect B2B",fandco_p3:"Le deuxième aspect de cette mission consistait à créer des dashboards afin de développer l’aspect B2B et ainsi présenter la plus-value de l’application aux futurs clients. Ces tableaux de bord, créés avec Power BI, se sont avérés essentiels et à l’origine d’une nouvelle stratégie de communication envers les potentiels partenaires B2B.",fandco_t4:"Nouvelles perspectives d'évolution",fandco_p4:"Ce projet m'a donné l’opportunité d’appliquer mes connaissances dans une entreprise ne disposant pas de pôle BI, j’ai donc pu observer l’impact de l’analyse décisionnelle à travers le changement d’organisation et la rapidité d’accès au données. Simultanément, les tableaux de bord personnalisés ont permis à l’entreprise de positionner plus efficacement son application, ouvrant la voie à de nouveaux partenariats et à une expansion sur le marché B2B.",xp:"EXPÉRIENCE",full_stack_web_developer:"Développeur web full stack",bi_consultant:"Consultant BI",ut1:"UNIVERSITÉ TOULOUSE CAPITOLE",master_miage:"Master 2 MIAGE ISIAD",desc_gpi:"Création d'un site internet immobilier",desc_orange:"Orange : monitoring du déploiement de la fibre optique en France métropolitaine via des dashboards Power BI",desc_airbus:"Airbus : supervision du renouvellement de l'infrastructure réseau d'Airbus Group",desc_fandco1:"Développement de dashboards B2B  via Power BI",desc_fandco2:"Automatisation de rapports d'analyse décisionnelle en élaborant des macros VBA",skills:"COMPÉTENCES",data_analysis:"ANALYSE DE DONNÉES",web_development:"DÉVELOPPEMENT WEB",contact:"CONTACT"}}}),qn=Nu(Sf);qn.use(Au());qn.use(Vr);qn.use(as);qn.mount("#app");qn.mixin({beforeRouteUpdate(e,t,n){const s=as.global.locale.value;s&&s!==as.global.locale.value&&(as.global.locale.value=s,localStorage.setItem("selectedLanguage",s)),n()}});export{$e as F,Ut as N,It as _,d as a,ee as b,wt as c,B as d,yt as e,tt as o,Et as p,bt as r,D as t,ge as w};
